B.E_=A.b(s(["1. Ouyang, Y. & Zirr, T. (2023). Decorrelating ReSTIR Samplers via MCMC Mutations. High-Performance Graphics.","2. Bitterli, B., et al. (2021). Spatiotemporal Reservoir Resampling for Real-Time Ray Tracing with Dynamic Direct Lighting. ACM Transactions on Graphics (SIGGRAPH 2021).","3. Burley, B. (2012). Physically-Based Shading at Disney. ACM SIGGRAPH 2012 Course Notes."]),t.s)
B.IY=new A.ox("","This project originated from an academic endeavor to achieve mastery of the OpenGL Shading Language (GLSL) by tackling one of computer graphics' most formidable challenges: real-time path-traced global illumination within a fully dynamic environment. We selected Minecraft as our development platform for several key reasons. Its established modding frameworks (e.g., Iris/OptiFine) provide a robust foundation for shader injection, while its game world presents a uniquely diverse testbed for a wide spectrum of light transport effects. The environment offers everything from complex specular and dielectric materials like glass and water to volumetric phenomena such as atmospheric scattering, allowing for comprehensive experimentation. The core challenge was to design a rendering pipeline capable of simulating physically-based light transport at interactive framerates within a mutable voxel world, a task that demands highly efficient sampling and data management strategies.","",'Our implementation is a multi-stage pipeline designed to overcome the inherent limitations of the standard rasterization engine.\n\n**Geometry Capture and Scene Representation:** A fundamental prerequisite for path tracing is a coherent scene representation accessible to ray queries. Standard Minecraft rendering does not provide this. To solve this, we inject a Geometry Shader into the rendering pipeline. This shader intercepts the vertex stream for all visible chunks, processing the geometry to generate and output world-space vertex positions, normals, and material indices into a persistent Shader Storage Buffer Object (SSBO). This buffer effectively serves as a G-Buffer for static and dynamic geometry, creating an explicit representation of the voxel world that our path tracer can query for ray-triangle intersections, a capability that is otherwise not possible.\n\n**Physically-Based Material Model:** Light interaction is governed by a physically-based Bidirectional Scattering Distribution Function (BSDF) anchored in the principles of the Disney BRDF. This model supports a wide range of materials through intuitive parameters. Crucially, it has been extended to include specular transmission for dielectric materials like glass and water, and a thin-shell subsurface scattering approximation to realistically render translucent objects.\n\n**Light Sampling and Denoising via ReSTIR:** To achieve interactive performance, we employ a state-of-the-art sampling strategy based on Reservoir-based Spatiotemporal Importance Resampling (ReSTIR). Specifically, we leverage the techniques described in "Decorrelating ReSTIR Samplers via MCMC Mutations." At its core, our sampler maintains reservoirs of potentially significant light samples at each pixel, which are reused across both space and time to amortize the cost of path discovery. To combat the temporal correlation and visual artifacts that can arise from naive reservoir reuse, we interleave the resampling process with Markov Chain Monte Carlo (MCMC) mutations. These mutations, such as perturbing ray directions, or shifting paths, effectively decorrelate the spatiotemporal samples, leading to faster convergence and a more robust image. The entire process is guided by importance sampling to prioritize rays and samples that contribute most significantly to the final image.\n\n**Adaptive Path Tracing and Difficulty Caching:** We further optimize performance by recognizing that lighting complexity is not uniform across the scene. The engine maintains a screen-space "difficulty cache" that stores metrics on lighting variance and complexity. For example, dark, enclosed regions with significant indirect lighting require more sophisticated sampling strategies than brightly-lit outdoor areas. By tracking this cache alongside player camera movement, the path tracer dynamically adapts its strategy. In "difficult" regions, it may increase the number of MCMC mutations, extend the path depth for additional bounces (branching), or increase the spatial search radius for reservoir reuse. Conversely, in simpler regions, these parameters are relaxed to conserve computational resources. This adaptive approach extends to computationally intensive effects like multi-bounce reflections, which are only enabled when material properties and viewing conditions deem them visually significant.',"",B.E_)
B.F0=A.b(s(["Key Technologies: AWS (EC2, RDS)","Predictive Models: Transformers, Autoencoders, ARIMA","Unsupervised Learning: t-SNE, DBSCAN","API Development: RESTful Principles"]),t.s)
B.IZ=new A.ox("Modern digital product development is data-rich, yet teams often struggle to convert raw user analytics into actionable design insights. Existing tools frequently present developers and designers with either inscrutable raw data streams or rigid, inflexible dashboards. This paper outlines a novel user analytics platform I designed to bridge this gap. My system is built on three core principles: the algorithmic abstraction of raw data into semantic behaviors, fully configurable user-authored dashboards, and a powerful node-based interface for customizing the analysis pipeline itself. By employing both heuristic and machine learning models\u2014including Autoencoders and Transformers\u2014to categorize user interactions and predict future behavior, and surfacing these insights in a modular workspace, my platform transforms analytics from a forensic chore into an intuitive, predictive, and collaborative design process, all powered by a custom, scalable backend infrastructure on AWS.","In the competitive landscape of software development, a deep understanding of user behavior is non-negotiable. However, a chasm persists between the data collected by analytics platforms and the tangible insights required by UI/UX designers and engineers. After extensive consultation with industry professionals who have expressed the shortcomings of established solutions like UXCam, I identified a recurring theme: a fundamental friction between data access and data interpretation. Teams are often forced to choose between manually sifting through raw session recordings\u2014a process that is both time-consuming and prone to missing broader patterns\u2014or relying on pre-canned metrics that obscure critical nuances.\n\nThis project was initiated to develop a viable alternative. My guiding philosophy is that an analytics tool should be an active analytical partner, not a passive data repository. I set out to build a system that empowers teams by automating the discovery of complex behaviors, providing unparalleled flexibility in data visualization, and offering deep customization of the analysis engine itself through an accessible, visual interface.","",'My platform\'s architecture is founded on four pillars designed to directly address the identified shortcomings of current-generation analytics tools.\n\n**1. From Raw Data to Semantic Insights**\n\nThe most significant barrier to effective analysis is the cognitive load of interpreting raw data. My primary innovation is a layer of algorithmic processing that automatically translates low-level interaction data (clicks, scrolls, view times) into high-level, semantically meaningful events and user categories. This is achieved through a combination of heuristics and unsupervised learning. Heuristic-based detectors are employed to flag common behavioral idioms such as "rage clicks," while manifold learning and clustering techniques (e.g., t-SNE, DBSCAN) discover emergent user archetypes without prior definition. The result is that previously invisible patterns become readily apparent, moving the analysis from "what happened" to "why it might be happening."\n\n**2. Predictive Modeling and Forecasting**\n\nBeyond descriptive analytics, the platform integrates predictive capabilities. For univariate time-series forecasting, such as predicting daily active users or feature adoption rates, I have integrated simpler, robust models like ARIMA. For more complex, multivariate pattern detection and prediction, the platform leverages advanced neural network architectures. Transformer models are employed to analyze sequences of user actions, enabling the system to predict the likelihood of a user converting or churning. Furthermore, I utilize Temporal Autoencoders for sophisticated anomaly detection, identifying user sessions that deviate significantly from established normal behavior, which could indicate fraudulent activity or a critical bug.\n\n**3. The User-Authored, Configurable Dashboard**\n\nTo solve "information hierarchy friction," my platform is built around a fully configurable, widget-based dashboard system. Users are not locked into a single view but can create multiple "custom dashboards"\u2014bespoke canvases for specific projects. Within each dashboard, users can drag, drop, and resize a library of data widgets, such as heatmaps, user funnels, and charts displaying predictive model outputs. These custom dashboards are easily shareable via a URL, streamlining collaboration.\n\n**4. Node-Based Analysis Pipeline with Hyperparameter Control**\n\nTo offer the ultimate level of control, I have integrated a node-based visual programming interface for the analytics engine. A user can visually chain together functional blocks to create a custom data pipeline. This modularity extends to the algorithms themselves. Key machine learning models are exposed as nodes with configurable inputs for their most critical hyperparameters. A user can, for example, directly adjust the learning rate of an autoencoder, the window size of an ARIMA model, or the number of attention heads in a Transformer directly from the visual editor, running experiments and observing the impact on their results without writing a single line of code.\n\n**5. System Architecture and Scalability**\n\nThe entire platform is powered by a custom RESTful API that serves as the bridge between the frontend client and the data processing backend. The infrastructure is built on Amazon Web Services for reliability and scale. Computational tasks, from data ingestion to the training and inference of machine learning models, are handled by a fleet of scalable Amazon EC2 instances. All user session data, metadata, and derived analytics are stored in a managed Amazon RDS (Relational Database Service) instance, ensuring data integrity, security, and high availability.',"The platform I have detailed represents a paradigm shift in user analytics. By moving beyond raw data presentation and focusing on automated insight discovery, user-centric customizability, and a transparent, accessible analysis engine, I empower teams to ask more complex questions of their data with greater ease. By integrating predictive analytics and offering unparalleled customization through a node-based hyperparameter interface, the platform transforms user analytics from a reactive, forensic process into a proactive, creative, and integral part of the product design lifecycle, ultimately leading to better products and more satisfied users.",B.F0)
B.Ff=A.b(s(["1. Bruneton, E. (2017). Precomputed Atmospheric Scattering. EGSR.","2. M\xfcller, T., Evans, A., Schied, C., & Keller, A. (2022). Compact Neural Graphics Primitives with Learned Hash Probing. ACM Transactions on Graphics (TOG), 41(4), 1-15."]),t.s)
B.J_=new A.ox("The realistic, real-time rendering of volumetric clouds remains a significant challenge in computer graphics, balancing visual fidelity with computational performance. This paper introduces a novel hybrid framework that achieves high-quality cloud rendering at interactive frame rates. The approach decouples the complex problem of volumetric light transport into three distinct properties: high-frequency density, smoother physical scattering mechanics, and low-frequency global illumination. I represent each of these properties using separate neural feature tables, which are indexed using a learned hashing scheme adapted from Compact Neural Graphics Primitives to operate on a guiding geometric mesh rather than a uniform grid. The training process leverages pre-computed, high-fidelity ground truth data generated by a volumetric path tracer. For real-time execution, I employ a two-pass deferred rendering pipeline. The first pass uses depth peeling to efficiently determine the entry and exit points of view rays through the cloud volume. The second pass is a full-screen neural evaluation shader that retrieves the decoupled feature vectors, processes them through small, specialized multi-layer perceptrons (MLPs) to compute final transmittance and scattering, and composes the final image. This method avoids traditional ray marching, enabling high performance while capturing complex and detailed cloud appearances.",'Volumetric clouds are a critical component of realistic outdoor scenes in simulations, games, and film. However, their semi-transparent, participating media nature, characterized by complex, high-frequency internal details and intricate light scattering, makes them exceptionally difficult to render efficiently. Traditional methods often force a compromise: fast techniques like billboard impostors suffer from parallax and repetition artifacts, while physically accurate methods like volumetric path tracing are prohibitively slow for real-time applications.\n\nRecent advancements in neural rendering, particularly Neural Radiance Fields (NeRFs), have demonstrated an incredible capacity for representing and rendering complex 3D scenes. However, standard NeRF architectures can be slow to train and evaluate, and their reliance on dense sampling along a ray is not ideal for the vast, largely empty spaces involved in cloud rendering.\n\nTo address these challenges, I present a novel rendering architecture that synthesizes the strengths of traditional geometric rasterization, pre-computed physical simulation, and modern neural representations. My approach begins with a moderately complex geometric mesh that serves as a "hull" for the cloud. Instead of marching rays through a volume, I use a rasterization-based depth-peeling technique to find the start and end points of a ray\'s passage through this hull for each pixel.\n\nThe core of my method is the decoupling of the cloud\'s appearance into three distinct neural feature tables:\n\nA Density Table (T_\u03c1): A high-resolution table capturing fine-scale density variations.\n\nA Mechanics Table (T_\u03bc): A medium-resolution table representing the intrinsic physical scattering properties of the cloud particles.\n\nA Lighting Table (T_L): A medium-resolution table representing the low-frequency global illumination and shadowing.\n\nThese tables are indexed using a learned, hash-based approach inspired by "Compact Neural Graphics Primitives with Learned Hash Probing," which I have adapted to work directly on the vertices of the cloud\'s geometric mesh. During a deferred shading pass, these retrieved features are fed into two small MLPs that learn to approximate the final transmittance and in-scattering, which are then composed for the final pixel color. This framework is trained end-to-end using data from a high-fidelity offline path tracer.\n\nThe primary contributions of this work are:\n\nA novel architecture that decouples cloud rendering into neural representations of density, scattering mechanics, and lighting.\n\nThe adaptation of learned hash-based indexing to a guiding geometric mesh, providing a memory-efficient and spatially-aware feature representation.\n\nA complete, two-pass deferred rendering pipeline that enables real-time evaluation of the neural representation without any per-pixel loops or marching.','The quest for realistic cloud rendering has a rich history. Early methods used particle systems or simple geometric shapes textured with procedural noise. A significant step forward came with methods based on volumetric ray marching through density fields, but these remain computationally expensive for real-time use.\n\nMy precomputation strategy is heavily informed by the work of Bruneton (2017) on precomputed atmospheric scattering. His work provides a robust, physically-based method for generating the kind of high-fidelity lighting and scattering data that I use as the ground truth for training my neural networks.\n\nThe rise of neural rendering has opened new avenues. Neural Radiance Fields (NeRF) have shown remarkable ability in view synthesis but typically require dense sampling and can be slow to query. Numerous follow-up works have aimed to accelerate NeRFs, with a key development being the use of sparse grid structures and hashing. In particular, my work on feature encoding and learned indexing is directly inspired by the paper "Compact Neural Graphics Primitives with Learned Hash Probing" by M\xfcller et al. (2022). This work introduced a highly efficient method for storing and retrieving neural features from a compact codebook using a learned hash function, drastically reducing memory footprint and improving performance. I adapt this concept from its original grid-based formulation to a mesh-based one.\n\nMy overall system architecture, which uses a G-Buffer pass followed by a deferred neural shading pass, is analogous to traditional deferred shading pipelines, but replaces standard material evaluation with the evaluation of learned neural functions.','My method consists of three main stages: an offline precomputation and data preparation stage, a training stage where the neural representations are learned, and a final real-time inference pipeline.\n\n**3.1. Setup & Precomputation**\n\nThe foundation of my method is high-quality ground truth data.\n\nGeometry: I begin with a high-quality density point cloud representing a cloud and generate various Levels of Detail (LODs) of a geometric "hull" mesh that encloses it.\n\nGround Truth Rendering: For a wide variety of points on and within the mesh, I use a high-fidelity volumetric path tracer capable of rendering clouds to compute transmission and scattering properties. This process is based on the principles outlined by Bruneton (2017). The result is a large dataset of rendered views under various lighting conditions (time-of-day/sun angle).\n\nClustering: I analyze the generated phase maps for these points and cluster them based on similarity in their scattering behavior. This clustering is performed over 3D space to produce a set of M representative points, and over both space and time-of-day to produce a set of L representative points. This step is critical for reducing the dimensionality of the mechanics and lighting data.\n\nData Tables: This process yields three datasets that will be used to train the corresponding neural tables: a Density dataset with an entry per vertex, a Mechanics dataset for each of the M clustered points, and a Lighting dataset for each of the L clustered points.\n\n**3.2. Neural Representation and Training**\n\nThe core of the rendering model is trained in a manner similar to NeRFs, using a differentiable rendering pipeline.\n\nGeometry Processing: The cloud is first represented by its geometric hull. In a preliminary pass during training, this hull is rendered to a G-buffer. I use a depth-peeling technique to store two depth values for each pixel: the distance to the front-most face (z_entry) and the back-most face (z_exit). Un-projecting these depths gives two world-space positions, p_entry and p_exit, defining the ray segment through the cloud for that pixel.\n\nLearned Feature Tables: I use three separate feature tables, each employing a learned lookup mechanism based on CompactNGP. Given an input coordinate (e.g., position), the system uses a small auxiliary codebook to learn how to probe into a main feature codebook, and the results from nearby vertices are interpolated. Gradients are propagated back using a straight-through estimator.\n\nThe Density Table (T_\u03c1): This is the largest table, trained to capture high-frequency detail. Its hashing function takes a 3D world-space position p and outputs a density feature vector v_\u03c1.\n\nThe Mechanics Table (T_\u03bc): This medium-sized table represents intrinsic scattering. Its hashing function takes a 3D position p and the view direction \u03c9_v to output a mechanics feature vector v_\u03bc.\n\nThe Lighting Table (T_L): This medium-sized table represents global illumination. Its hashing function takes a 3D position p and the sun direction \u03c9_s to output a lighting feature vector v_L.\n\nNeural Rendering MLPs: With the feature vectors retrieved, two small MLPs compute the final optical properties.\n\nLearned Transmittance (MLP_T): A simple Beer\'s Law calculation from just two points would be inaccurate. This small MLP learns a more robust, non-linear approximation of the transmittance through the volume.\n\nInput: The two density vectors (v_\u03c1_entry, v_\u03c1_exit) and the scalar thickness d = |p_exit - p_entry|.\n\nOutput: A single scalar transmittance value T.\n\nLearned Scattering (MLP_S): The final appearance is a complex fusion of all three components. A second, larger MLP learns this interplay.\n\nInput: The entry density vector v_\u03c1_entry, the mechanics vector v_\u03bc, and the lighting vector v_L.\n\nOutput: The final scatter color and intensity Color_scatter.\n\nFinal Composition: The final pixel color is a linear interpolation between the background sky color and the computed scatter color, using the learned transmittance T as the blending factor. The background sky Diffuse_Color is sampled from a standard environment map.\n\nFinal_Color = lerp(Diffuse_Color, Color_scatter, T)\n\nThe entire model is trained by minimizing the difference between the rendered Final_Color and the ground truth images from the precomputation stage.\n\n**3.3. Real-Time Rendering Pipeline**\n\nThe trained model is deployed in a highly efficient two-step deferred pipeline.\n\nStep 1: G-Buffer Pass (Geometry Rasterization)\nThis pass determines the per-pixel thickness of the cloud.\n\nExit Depth: With front-face culling and a depth function of GL_GREATER, I render the cloud hull to write the depth of the back faces to a texture (ExitDepth_Tex).\n\nEntry Depth: With back-face culling and a depth function of GL_LESS, I render the cloud hull again to write the depth of the front faces to a second texture (EntryDepth_Tex).\n\nThe output is two full-screen textures containing the nearest and farthest depths of the cloud volume for each pixel.\n\nStep 2: Deferred Shading Pass (Neural Evaluation)\nThis is a single full-screen pass that draws a screen-sized quad, with all logic executed in the fragment shader. For each fragment:\n\nReconstruct Positions: The entry_depth and exit_depth are sampled. If no cloud was hit, the pixel is discarded. Otherwise, the screen-space coordinates and depths are un-projected to find the world-space positions p_entry and p_exit.\n\nRetrieve Features: The view vector \u03c9_v and sun vector \u03c9_s are computed. Custom GLSL functions implement the CompactNGP-style lookup to retrieve the feature vectors v_\u03c1_entry, v_\u03c1_exit, v_\u03bc, and v_L from their respective tables.\n\nEvaluate MLPs: GLSL functions that encode the weights and architecture of MLP_T and MLP_S are executed to compute the final transmittance T and scattering color Color_scatter.\n\nFinal Composition: The background sky color is sampled from a skybox using the view vector, and the final color is blended using the computed transmittance T. This color is then written to the framebuffer.\n\nThis process is highly parallel and avoids any form of ray marching or loops in the shader, making it extremely fast on modern GPU hardware.',"I have presented a novel framework for the real-time, high-fidelity rendering of volumetric clouds. By decoupling the problem into neural representations for density, mechanics, and lighting, and by leveraging a mesh-based learned hashing scheme, my method achieves a powerful and efficient representation. The real-time performance is enabled by a two-pass deferred pipeline that replaces traditional ray marching with a single-pass neural evaluation. This hybrid approach combines the geometric efficiency of rasterization with the expressive power of neural networks, trained on physically-based ground truth data.\n\nFuture work could focus on extending this framework to support dynamic clouds, where the feature tables could be conditioned on time to represent cloud evolution. Further investigation into multi-layer depth peeling could allow for the rendering of more complex topologies, such as clouds with holes. Finally, exploring the use of hardware-accelerated ray tracing to generate the entry/exit points could offer an alternative to the rasterization-based G-buffer pass.",B.Ff)
B.EO=A.b(s(["1. Jensen, H. W., Marschner, S. R., Levoy, M., & Hanrahan, P. (2001). A Practical Model for Subsurface Light Transport. Proceedings of the 28th Annual Conference on Computer Graphics and Interactive Techniques (SIGGRAPH '01).","2. Donner, C., & Jensen, H. W. (2006). A Spectral BSSRDF for Shading Human Skin. Proceedings of the 17th Eurographics Symposium on Rendering.","3. Graham, A., et al. (2017). Physically-Based Shading in Film and Game Production. ACM SIGGRAPH 2017 Courses.","4. Nvidia Corporation. (2007). Advanced Skin Rendering. GDC 2007."]),t.s)
B.J0=new A.ox("",'The rendering of photorealistic digital humans remains a paramount challenge in computer graphics, often referred to as the "holy grail" of the field. Achieving true realism necessitates a departure from simple surface-based shading models towards a comprehensive simulation of light\'s complex interaction with translucent, multi-layered biological media. This project documents our methodology for creating a digital portrait, focusing on an anatomically-informed workflow. Our approach combines high-frequency sculpting, a multi-layered texturing process differentiating between mesoscale and microscale surface properties, and an advanced subsurface scattering (SSS) model that accounts for the influence of underlying anatomical structures, such as the skull, on light transport within the skin.',"",'Our pipeline is a sequential process that builds layers of detail, from gross anatomical structure to microscopic surface properties and complex internal light behavior.\n\n**A. Anatomical Foundation and High-Frequency Sculpting:** The process began in ZBrush, where we established the primary and secondary forms of the human head based on rigorous anatomical study. Asymmetry, a crucial component of realism, was introduced early and maintained throughout. Using photographic references, we sculpted tertiary, mesoscale details such as pores, fine wrinkles, and skin imperfections. This high-frequency geometric detail serves as the foundational canvas for our subsequent texturing and shading work.\n\n**B. Multi-Layered PBR Texturing:** We utilized Substance Painter and Designer to create a comprehensive set of physically-based textures. A key distinction was made between mesoscale detail, which was baked from the ZBrush sculpt into our normal maps, and microscale detail\u2014the near-imperceptible cellular texture of the skin\u2014which was procedurally generated and layered into the roughness and specular maps. This creates a surface that responds realistically to light at various viewing distances. Textures were developed for distinct facial regions to account for physiological variations; for example, the forehead and nasal regions were given higher specular and lower roughness values to simulate sebaceous gland activity, contrasting with the drier, rougher texture of the cheeks.\n\n**C. Multi-Layered Subsurface Scattering:** To simulate the translucency of skin, we moved beyond a monolithic SSS approach. Within Blender, utilizing the LuxCoreRender engine, we implemented a multi-layered Bidirectional Surface Scattering Reflectance Distribution Function (BSSRDF). This model treats skin as a composite of distinct biological layers:\n - **An Epidermal Layer:** A shallow-depth texture map containing melanin and fine capillary details, with a short scattering radius and a slightly bluish tint to simulate Rayleigh scattering.\n - **A Dermal Layer:** A mid-depth texture map representing the highly vascularized dermis, characterized by a broader scattering radius and a deep red scattering color.\n - **A Subdermal/Hypodermal Layer:** The deepest layer, which further diffuses light.\n\n**D. Anatomical Occlusion and Skull Influence:** A novel aspect of our approach was simulating the influence of the underlying cranium on deep light transport. Light scattering deep within the tissue is not uniform; it is occluded and attenuated by bone. In regions where the skull is close to the surface (e.g., the forehead, zygomatic arch, and jawline), deep red scattering is visibly reduced. We simulated this by using a "bone proximity" map, which was then used to modulate the intensity and color of the dermal and subdermal SSS layers. This prevents the "gummy" or "waxy" look common in simpler SSS models and grounds the final render in physical anatomy. The entire scene was assembled and rendered in Blender with LuxCoreRender, chosen for its robust, physically accurate volumetric and multi-layered material capabilities.',"",B.EO)
